import React from 'react'

const Perguntas = ({ perguntas }) => {
    const listaPerguntas = perguntas.map( (pergunta) => <li key={pergunta.description}>{pergunta.description}</li>);

    return (
        <div>
          {listaPerguntas}
        </div>
    );

}

export default Perguntas
